import React from 'react'
import UserCard from './UserCard';


function Userlist() {

  useSelector
  return (
    <div style={{display:"grid",gridTemplateColumns:"1fr 1fr 1fr",placeItems:"center",marginTop:"50px",gap:"30px"}}>
      <UserCard/>
      <UserCard/>
      <UserCard/>
      <UserCard/>
      <UserCard/>
      <UserCard/>
    </div>
  )
}

export default Userlist;
